    [],nt"revision_timestamp": "2015-10-06T08:36:50.301260",nt"name": "montana-moyoco-invasive-species-strike-team-final-report-2014-swan-river-national-wildlife",nt"isopen":
    false,nt"url": null,nt"notes": "The MOYOCO MT Invasive Species Strike Team
    is made up of two field strike teams, housed at Benton Lake and Lee Metcalf National
    Wildlife Refuges, yet administered by the Region 6 Invasive Species Program.  The
    teams conduct invasive plant management on National Wildlife Refuges and Waterfowl
    Production Areas in Montana and northern Wyoming.  Several invasive plant species
    are chemically, biologically and manually treated, inventoried, and monitored. Annually
    a final report is provided describing all projects completed. The full final report
    includes an overall summary and a chapter for each national wildlife refuge or waterfowl
    management district.",nt"license_title": "License Not Specified",nt"extras":
